<!DOCTYPE html>
<html>
<head>
   <title>GPS Speck Visualization</title>
   <style type="text/css">
      html, body {
         height: 100%;
         margin: 0px;
         padding: 0px
      }

      body {
         font-family: "Gill Sans Light", Verdana, Arial, sans-serif !important;
         font-size: 10pt !important;
      }

      #mapArea {
         height: 100%;
         margin: 0px;
         padding: 0px
      }
   </style>
   <script type="text/javascript" src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCGR21nG0gjPnQZtlCbPIxpDcJ2T2fOrf8&sensor=false"></script>
   <script src="http://ajax.googleapis.com/ajax/libs/jquery/1.10.2/jquery.min.js"></script>
   <script language="JavaScript" type="text/javascript">

      var MIN_PARTICLES = 0;
      var MAX_PARTICLES = 5000;
      var HSL_RED = 0;
      var HSL_GREEN = 120;

      var minParticles = 10000;
      var maxParticles = -10000;

      var map;
      var infoWindow = new google.maps.InfoWindow();

      $(document).ready(function() {
         initializeMap();
      });

      function getColorHue(valRaw) {
         var val = Math.min(Math.max(valRaw, MIN_PARTICLES), MAX_PARTICLES);
         var percentage = val / MAX_PARTICLES;
         return Math.round(HSL_GREEN - (HSL_GREEN * percentage));
      }

      function initializeMap() {
         console.log("In init map");
         var mapOptions = {
            center : new google.maps.LatLng(40.44336499421941, -79.95033645738602),
            zoom : 17,
            mapTypeId : google.maps.MapTypeId.ROADMAP
         };
         map = new google.maps.Map(document.getElementById("mapArea"), mapOptions);
         google.maps.event.addListener(map, 'bounds_changed', function() {
            console.log("Map bounds changed");
         });

         // Add an idle event listener ONCE to handle map loading.
         google.maps.event.addListenerOnce(map, 'idle', function() {
            console.log("Map is done loading");

            renderPath();
         });
      }

      function renderPath() {

         var walk = [];

         $.each(data, function(index, record) {
            var fields = record.split(',');
            var timeUtcSecs = parseInt(fields[0]);
            var particles = parseInt(fields[2]);
            var latRaw = fields[4];
            var lngRaw = fields[5];
            var quadrant = fields[6];
            var southernHemisphereMultiplier = quadrant.substr(0, 1) == "S" ? -1 : 1;
            var westernHemisphereMultiplier = quadrant.substr(1, 1) == "W" ? -1 : 1;
            var lat = convertGpsCoord(latRaw) * southernHemisphereMultiplier;
            var lng = convertGpsCoord(lngRaw) * westernHemisphereMultiplier;
            var latLong = new google.maps.LatLng(lat, lng);
            walk.push(latLong);

            minParticles = Math.min(minParticles, particles);
            maxParticles = Math.max(maxParticles, particles);

            addMarker(timeUtcSecs, particles, latLong);
         });

         var walkPath = new google.maps.Polyline({
                                                    path : walk,
                                                    geodesic : true,
                                                    strokeColor : '#000000',
                                                    strokeOpacity : 1.0,
                                                    strokeWeight : 2
                                                 });

         walkPath.setMap(map);
      }

      function convertGpsCoord(val) {
         return parseInt(val.substr(0, 2)) + (val.substr(2) / 60);
      }

      // Add a marker to the map and push to the array.
      function addMarker(timeUtcSecs, value, location) {
         var hue = getColorHue(value);
         var marker = new google.maps.Marker({
                                                position : location,
                                                map : map,
                                                icon : {
                                                   path : google.maps.SymbolPath.CIRCLE,
                                                   fillColor : 'hsl(' + hue + ',100%,50%)',
                                                   fillOpacity : 1,
                                                   strokeColor : '#000000',
                                                   strokeOpacity : 0,
                                                   strokeWeight : 0,
                                                   scale : 4 //pixels
                                                }
                                             });
         google.maps.event.addListener(marker,
                                       'click',
                                       function() {
                                          console.log("record = [" + timeUtcSecs + "," + value + "," + location.toString() + "]");
                                       });

         google.maps.event.addListener(marker, 'mouseover', function() {
            var content = '<div class="infowin">' +
                          '<b>Particles: </b>' + value + '<br>' +
                          '<b>Time: </b>' + new Date(timeUtcSecs*1000) +
                          '</div>';
            infoWindow.setContent(content);
            infoWindow.open(map, marker);
         });
         google.maps.event.addListener(marker, 'mouseout', function() {
            infoWindow.close();
         });
      }

   </script>
